import React from 'react';
import logo from './logo.svg';
import './App.css';
import Message from './components/Message';

function App() {
  return (
    <div className="App">
      <Message 
      name="Vasya"
      logo={logo}
      title="Title"
      text="Hello World"
      />  
      <Message 
      name="Oleg"
      logo={logo}
      title="Title Oleg"
      text="Hello World"
      />  
      <Message 
      name="Maria"
      logo={logo}
      title="Title Maria"
      text="Hello World"
      />  
    </div>
  );
}

export default App;
